import React from 'react'

export default function Navbar() {

  const OnMouseEnter = (e)=>{
      e.target.style.transform="scale(1.3,1.3)"
  }

   const OnMouseLeave = (e)=>{
      e.target.style.transform="scale(1,1)"
  }

  return (
    <nav className='navbar fixed w-full'>
        <div className='w-[80%] my-0 mx-auto flex items-center justify-between'>
            <p className=' text-[30px] '>
                Portfolio 
            </p>
            <div className='flex items-center justify-evenly text-[20px]'>
                <li onMouseEnter={OnMouseEnter} onMouseLeave={OnMouseLeave} className='list-none hover:cursor-pointer transition-transform duration-150 ease-in px-[150px] '>Projet</li>
                <li onMouseEnter={OnMouseEnter} onMouseLeave={OnMouseLeave} className='list-none hover:cursor-pointer transition-transform duration-150 ease-in px-[150px] '>Skills</li>
                <li onMouseEnter={OnMouseEnter} onMouseLeave={OnMouseLeave} className='list-none hover:cursor-pointer transition-transform duration-150 ease-in px-[150px] '>About</li>
                <li onMouseEnter={OnMouseEnter} onMouseLeave={OnMouseLeave} className='list-none hover:cursor-pointer transition-transform duration-150 ease-in px-[150px] '>Contact</li>
            </div>
        </div>
    </nav>
  )
}
